CREATE TABLE SGDTEST.DCT_ASIGNACION
(
    IDE_ASIGNACION NUMBER(18) PRIMARY KEY NOT NULL,
    FEC_ASIGNACION TIMESTAMP(6) NOT NULL,
    IDE_DOCUMENTO NUMBER(18) NOT NULL,
    IDE_AGENTE NUMBER(18) DEFAULT NULL
,
    IDE_FUNCI NUMBER(18) DEFAULT NULL
,
    COD_DEPENDENCIA VARCHAR2(32) DEFAULT NULL
,
    COD_TIP_ASIGNACION VARCHAR2(8) NOT NULL,
    OBSERVACIONES VARCHAR2(500) DEFAULT NULL
,
    COD_TIP_CAUSAL VARCHAR2(12) DEFAULT NULL
,
    IDE_USUARIO_CREO VARCHAR2(18) NOT NULL,
    FEC_CREO TIMESTAMP(6) NOT NULL,
    COD_TIP_PROCESO VARCHAR2(8) DEFAULT NULL
,
    CONSTRAINT DCT_ASIGNACION_IDE_AGENTE_FK FOREIGN KEY (IDE_AGENTE) REFERENCES COR_AGENTE (IDE_AGENTE)
);
